/** @jsx jsx */
import { css, jsx } from "@emotion/core"
import tw from "tailwind.macro";

const Button = (props) => (
    <button 
        onClick={() => props.onClick}
        css={tw`flex p-2 rounded-full shadow-none font-display`}
    >
        { props.img_src 
        ? <img src={props.img_src} alt="Button"></img> 
        : null
        }
        {props.text}
    </button>
)

export default Button
